import React from 'react';
import ReactDOM from 'react-dom';
import './assets/main.css';
import App from './App.jsx';
import { BrowserRouter as Router } from 'react-router-dom';


ReactDOM.render(
  <React.StrictMode>
       <Router>
       <App />    
    </Router>
  </React.StrictMode>,
  document.getElementById('root')
);
